sys_variable_value.value:
(function execute(inputs, outputs) {
var gr = new GlideRecord('incident');
gr.addQuery('caller_id',inputs.user.sys_id);
gr.query();
var incidents=[];
while(gr.next())
{
    incidents.push(gr.number.toString());
}
outputs.incidents=incidents

})(inputs, outputs);

